import React from 'react';

function PortfolioBox(props) {
  console.log(props);
  return (
    <div>
      <img
        src={props.image}
        alt={props.title + ' logo'}
        height="300"
        width="400"
      />
      <h3>{props.title}</h3>
      <h4>{props.description}</h4>
    </div>
  );
}

export default PortfolioBox;
